while ((oid = negotiator->next(negotiator))){
    packet_buf_write(&req_buf, "have %s\n", oid_to_hex(oid));
    print_verbose(args, "have %s", oid_to_hex(oid));
    in_vain++;
    haves++;
    if (flush_at <= ++count){
        int ack;
        negotiation_round++;
        trace2_region_enter_printf("negotiation_v0_v1", "round", the_repository, "%d", negotiation_round);
        trace2_data_intmax("negotiation_v0_v1", the_repository, "haves_added", haves);
        trace2_data_intmax("negotiation_v0_v1", the_repository, "in_vain", in_vain);
        haves = 0;
        packet_buf_flush(&req_buf);
        send_request(args, fd[1], &req_buf);
        strbuf_setlen(&req_buf, state_len);
        flushes++;
        flush_at = next_flush(args->stateless_rpc, count);
        if (!args->stateless_rpc && count == INITIAL_FLUSH)
            continue;

        consume_shallow_list(args, &reader);
        do{
            ack = get_ack(&reader, result_oid);
            if (ack)
                print_verbose(args, _("got %s %d %s"), "ack", ack, oid_to_hex(result_oid));

            switch (ack){
                case ACK:
                    trace2_region_leave_printf("negotiation_v0_v1", "round", the_repository, "%d", negotiation_round);
                    flushes = 0;
                    multi_ack = 0;
                    retval = 0;
                    goto done;
                case ACK_common:
                case ACK_ready:
                case ACK_continue:
                    {
                        struct commit* commit = lookup_commit(the_repository, result_oid);
                        int was_common;
                        if (!commit)
                            die(_("invalid commit %s"), oid_to_hex(result_oid));

                        was_common = negotiator->ack(negotiator, commit);
                        if (args->stateless_rpc && ack == ACK_common && !was_common){
                            const char* hex = oid_to_hex(result_oid);
                            packet_buf_write(&req_buf, "have %s\n", hex);
                            state_len = req_buf.len;
                            haves++;
                            in_vain = 0;
                    }else
                        if (!args->stateless_rpc || ack != ACK_common)
                            in_vain = 0;

                    retval = 0;
                    got_continue = 1;
                    if (ack == ACK_ready)
                        got_ready = 1;

                    break;
                }
            }
        } while (ack);
        flushes--;
        trace2_region_leave_printf("negotiation_v0_v1", "round", the_repository, "%d", negotiation_round);
        if (got_continue && MAX_IN_VAIN < in_vain){
            print_verbose(args, _("giving up"));
            break;
        }
        if (got_ready)
            break;
    }
}

