if ((lookup = string_list_lookup(renames2Dst, ren1_dst))){
    char* ren2_dst;
    ren2 = lookup->util;
    ren2_dst = ren2->pair->two->path;
    if (strcmp(ren1_dst, ren2_dst) != 0)
        BUG("ren1_dst != ren2_dst");

    clean_merge = 0;
    ren2->processed = 1;
    ren2->src_entry->processed = 1;
    setup_rename_conflict_info(RENAME_TWO_FILES_TO_ONE, opt, ren1, ren2);
}else{
    struct diff_filespec src_other, dst_other;
    int try_merge;
    int renamed_stage = a_renames == renames1 ? 2 : 3;
    int other_stage = a_renames == renames1 ? 3 : 2;
    int renamed_to_self = !strcmp(ren1_src, ren1_dst);
    if (!renamed_to_self)
        remove_file(opt, 1, ren1_src, renamed_stage == 2 || !was_tracked(opt, ren1_src));

    oidcpy(&src_other.oid, &ren1->src_entry->stages[other_stage].oid);
    src_other.mode = ren1->src_entry->stages[other_stage].mode;
    oidcpy(&dst_other.oid, &ren1->dst_entry->stages[other_stage].oid);
    dst_other.mode = ren1->dst_entry->stages[other_stage].mode;
    try_merge = 0;
    if (oideq(&src_other.oid, null_oid()) && ren1->dir_rename_original_type == 'A'){
        setup_rename_conflict_info(RENAME_VIA_DIR, opt, ren1, NULL);
    }else
        if (renamed_to_self){
            setup_rename_conflict_info(RENAME_NORMAL, opt, ren1, NULL);
        }else
            if (oideq(&src_other.oid, null_oid())){
                setup_rename_conflict_info(RENAME_DELETE, opt, ren1, NULL);
            }else
                if ((dst_other.mode == ren1->pair->two->mode) && oideq(&dst_other.oid, &ren1->pair->two->oid)){
                    if (update_file_flags(opt, ren1->pair->two, ren1_dst, 1, 0))
                        clean_merge = -1;
                }else
                    if (!oideq(&dst_other.oid, null_oid())){
                        setup_rename_conflict_info(RENAME_ADD, opt, ren1, NULL);
                    }else
                        try_merge = 1;

    if (clean_merge < 0)
        goto cleanup_and_return;

    if (try_merge){
        struct diff_filespec *o, *a, *b;
        src_other.path = (char*)ren1_src;
        o = ren1->pair->one;
        if (a_renames == renames1){
            a = ren1->pair->two;
            b = &src_other;
        }else{
            b = ren1->pair->two;
            a = &src_other;
        }
        update_entry(ren1->dst_entry, o, a, b);
        setup_rename_conflict_info(RENAME_NORMAL, opt, ren1, NULL);
    }
}

