while ((commit = prio_queue_get(&queue))){
    struct rev_name* name = get_commit_rev_name(commit);
    struct commit_list* parents;
    int parent_number = 1;
    parents_to_queue_nr = 0;
    for (parents = commit->parents;parents;parents = parents->next, parent_number++){
        struct commit* parent = parents->item;
        struct rev_name* parent_name;
        int generation, distance;
        repo_parse_commit(the_repository, parent);
        if (commit_is_before_cutoff(parent))
            continue;

        if (parent_number > 1){
            generation = 0;
            distance = name->distance + MERGE_TRAVERSAL_WEIGHT;
        }else{
            generation = name->generation + 1;
            distance = name->distance + 1;
        }
        parent_name = create_or_update_name(parent, taggerdate, generation, distance, from_tag);
        if (parent_name){
            if (parent_number > 1)
                parent_name->tip_name = get_parent_name(name, parent_number, string_pool);
            else
                parent_name->tip_name = name->tip_name;

            ALLOC_GROW(parents_to_queue, parents_to_queue_nr + 1, parents_to_queue_alloc);
            parents_to_queue[parents_to_queue_nr] = parent;
            parents_to_queue_nr++;
        }
    }
    while (parents_to_queue_nr)
        prio_queue_put(&queue, parents_to_queue[--parents_to_queue_nr]);
}

