switch ((ch = *quoted++)){
    case 'a':
        ch = '\a';
        break;
    case 'b':
        ch = '\b';
        break;
    case 'f':
        ch = '\f';
        break;
    case 'n':
        ch = '\n';
        break;
    case 'r':
        ch = '\r';
        break;
    case 't':
        ch = '\t';
        break;
    case 'v':
        ch = '\v';
        break;
    case '\\':
    case '"':
        break;
    case '0':
    case '1':
    case '2':
    case '3':
        ac = ((ch - '0') << 6);
        if ((ch = *quoted++) < '0' || '7' < ch)
            goto error;

        ac |= ((ch - '0') << 3);
        if ((ch = *quoted++) < '0' || '7' < ch)
            goto error;

        ac |= (ch - '0');
        ch = ac;
        break;
    default:
        goto error;
}

