while ((commit = get_revision(&revs))){
    const struct name_decoration* decoration;
    khint_t pos;
    int hr;
    if (!commit->parents)
        die(_("replaying down to root commit is not supported yet!"));

    if (commit->parents->next)
        die(_("replaying merge commits is not supported yet!"));

    last_commit = pick_regular_commit(commit, replayed_commits, onto, &merge_opt, &result);
    if (!last_commit)
        break;

    pos = kh_put_oid_map(replayed_commits, commit->object.oid, &hr);
    if (hr == 0)
        BUG("Duplicate rewritten commit: %s\n", oid_to_hex(&commit->object.oid));

    kh_value(replayed_commits, pos) = last_commit;
    if (advance_name)
        continue;

    decoration = get_name_decoration(&commit->object);
    if (!decoration)
        continue;

    while (decoration){
        if (decoration->type == DECORATION_REF_LOCAL && (contained || strset_contains(update_refs, decoration->name))){
            printf("update %s %s %s\n", decoration->name, oid_to_hex(&last_commit->object.oid), oid_to_hex(&commit->object.oid));
        }
        decoration = decoration->next;
    }
}

