while ((commit = get_revision(revs))){
    struct commit_list* to_merge;
    const char *p1, *p2;
    struct object_id* oid;
    int is_empty;
    tail = &commit_list_insert(commit, tail)->next;
    oidset_insert(&interesting, &commit->object.oid);
    is_empty = is_original_commit_empty(commit);
    if (!is_empty && (commit->object.flags & PATCHSAME)){
        if (flags & TODO_LIST_WARN_SKIPPED_CHERRY_PICKS)
            warning(_("skipped previously applied commit %s"), short_commit_name(the_repository, commit));

        skipped_commit = 1;
        continue;
    }
    if (is_empty && !keep_empty)
        continue;

    strbuf_reset(&oneline);
    pretty_print_commit(pp, commit, &oneline);
    to_merge = commit->parents ? commit->parents->next : NULL;
    if (!to_merge){
        strbuf_reset(&buf);
        strbuf_addf(&buf, "%s %s %s", cmd_pick, oid_to_hex(&commit->object.oid), oneline.buf);
        if (is_empty)
            strbuf_addf(&buf, " %s empty", comment_line_str);

        FLEX_ALLOC_STR(entry, string, buf.buf);
        oidcpy(&entry->entry.oid, &commit->object.oid);
        oidmap_put(&commit2todo, entry);
        continue;
    }
    strbuf_reset(&label);
    if (skip_prefix(oneline.buf, "Merge ", &p1) && (p1 = strchr(p1, '\'')) && (p2 = strchr(++p1, '\'')))
        strbuf_add(&label, p1, p2 - p1);
    else
        if (skip_prefix(oneline.buf, "Merge pull request ", &p1) && (p1 = strstr(p1, " from ")))
            strbuf_addstr(&label, p1 + strlen(" from "));
        else
            strbuf_addbuf(&label, &oneline);

    strbuf_reset(&buf);
    strbuf_addf(&buf, "%s -C %s", cmd_merge, oid_to_hex(&commit->object.oid));
    for (;to_merge;to_merge = to_merge->next){
        oid = &to_merge->item->object.oid;
        strbuf_addch(&buf, ' ');
        if (!oidset_contains(&interesting, oid)){
            strbuf_addstr(&buf, label_oid(oid, NULL, &state));
            continue;
        }
        tips_tail = &commit_list_insert(to_merge->item, tips_tail)->next;
        strbuf_addstr(&buf, label_oid(oid, label.buf, &state));
    }
    strbuf_addf(&buf, " # %s", oneline.buf);
    FLEX_ALLOC_STR(entry, string, buf.buf);
    oidcpy(&entry->entry.oid, &commit->object.oid);
    oidmap_put(&commit2todo, entry);
}

