        case SM_UPDATE_CHECKOUT:
            die_message(_("Unable to checkout '%s' in submodule path '%s'"), oid, ud->displaypath);
            break;
        case SM_UPDATE_REBASE:
            ret = die_message(_("Unable to rebase '%s' in submodule path '%s'"), oid, ud->displaypath);
            break;
        case SM_UPDATE_MERGE:
            ret = die_message(_("Unable to merge '%s' in submodule path '%s'"), oid, ud->displaypath);
            break;
        case SM_UPDATE_COMMAND:
            ret = die_message(_("Execution of '%s %s' failed in submodule path '%s'"), ud->update_strategy.command, oid, ud->displaypath);
            break;
        default:
            BUG("unexpected update strategy type: %d", ud->update_strategy.type);
    }
    return ret;
}

