    for (top = blk + bsize;cur < top;){
        prev = cur;
        hav = xdl_hash_record(&cur, top, xpp->flags);
        if (XDL_ALLOC_GROW(recs, nrec + 1, narec))
            goto abort;

        if (!(crec = xdl_cha_alloc(&xdf->rcha)))
            goto abort;

        crec->ptr = prev;
        crec->size = (long )(cur - prev);
        crec->ha = hav;
        recs[nrec++] = crec;
        if (xdl_classify_record(pass, cf, rhash, hbits, crec) < 0)
            goto abort;
    }
}

